import React from 'react';
import './App.css';
import hund_bild from './doggo2.png'
import Typical from 'react-typical';


function Home() {
  return (
    <div className="App">
      <header className="App-header">

        <img src={hund_bild} className="App-logo" alt="logo" />
        <p>
          Halloj!
        </p>
        <a
          className="App-link"
          href="https://www.youtube.com/watch?v=dQw4w9WgXcQ"
          target="_blank"
          rel="noopener noreferrer"
        >
          Klicka för att få höra min favoritlåt!!
        </a>

        <p>hejsan hoppsan</p>

        <Typical
        steps={['Tjena Henric', 1000, 'Tjena Wiktor!', 1000]}
        loop={Infinity}
        wrapper="p"
        />




      </header>
    </div>
  );
}

Header=React.createClass({
  render(){
    return(
      <div>
        <div className="navbar navbar-default">
          <div CLASSnAME="container">
            <a className="navbar-brag">Mysite Name</a>
          </div>
        </div>
      </div>
    )
  }
})

export default Home;
